export default function UserNew() {
  console.log("UserNew");

  let [userNewState, dispatchUserNew] = useContext(context).userNewReducer;
  let user = userNewState.user;

  const handleAddUser = (lorem) => {
    dispatchUserNew({
      type: ADD_NEWUSER,
      user: lorem,
    });
  };
  return <div>UserNew</div>;
}

